import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { library } from '@fortawesome/fontawesome-svg-core';
import { 
  faStore, 
  faUsers, 
  faPlus, 
  faChevronDown, 
  faChevronLeft, 
  faChevronRight, 
  faTimes, 
  faEdit, 
  faBan 
} from '@fortawesome/free-solid-svg-icons';

// Add Font Awesome icons to the library
library.add(
  faStore, 
  faUsers, 
  faPlus, 
  faChevronDown, 
  faChevronLeft, 
  faChevronRight, 
  faTimes, 
  faEdit, 
  faBan
);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
